/* eslint-disable react/prop-types */
import React from 'react';
import style from './style';

const TextField = (props) => {
  const { disabled, placeholder, isError } = props;
  let { common, error } = style;
  if (isError) {
    common = {
      ...common,
      ...error
    }
  } 
  return (
    <input type="text" />
  );
};

export default TextField;
